import React from "react";
import Navbar from "./components/Navbar";
import Router from "./router";
import Footer from "./components/Footer";
import { ProductContextProvider } from "./Context";

const App = () => {
  return (
    <>
      <ProductContextProvider>
        <div>
          <Navbar />
          <Router />
          <Footer />
        </div>
      </ProductContextProvider>
    </>
  );
};

export default App;
